import React from 'react';
import {
  Box,
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  CardMedia,
} from '@mui/material';
import VideoSettingsIcon from '@mui/icons-material/VideoSettings';
import StorageIcon from '@mui/icons-material/Storage';
import BarChartIcon from '@mui/icons-material/BarChart';
import SecurityIcon from '@mui/icons-material/Security';
import SpeedIcon from '@mui/icons-material/Speed';
import CloudUploadIcon from '@mui/icons-material/CloudUpload';

const Features = () => {
  const features = [
    {
      icon: <VideoSettingsIcon sx={{ fontSize: 56 }} />,
      title: 'Advanced Processing',
      description: 'State-of-the-art video processing algorithms for optimal results'
    },
    {
      icon: <StorageIcon sx={{ fontSize: 56 }} />,
      title: 'Secure Storage',
      description: 'Your processed videos are stored securely and easily accessible'
    },
    {
      icon: <BarChartIcon sx={{ fontSize: 56 }} />,
      title: 'Detailed Analytics',
      description: 'Comprehensive analytics and insights for your processed content'
    },
    {
      icon: <SecurityIcon sx={{ fontSize: 56 }} />,
      title: 'Enterprise Security',
      description: 'Industry-leading security measures to protect your data'
    },
    {
      icon: <SpeedIcon sx={{ fontSize: 56 }} />,
      title: 'Real-time Processing',
      description: 'Lightning-fast processing speeds for immediate results'
    },
    {
      icon: <CloudUploadIcon sx={{ fontSize: 56 }} />,
      title: 'Easy Integration',
      description: 'Seamlessly integrate with your existing workflow'
    }
  ];

  return (
    <Box>
      {/* Hero Section */}
      <Box sx={{ bgcolor: 'primary.main', color: 'white', py: 12 }}>
        <Container maxWidth="lg">
          <Typography variant="h2" component="h1" textAlign="center" gutterBottom>
            Powerful Features for Video Processing
          </Typography>
          <Typography variant="h5" textAlign="center" sx={{ mb: 4, maxWidth: '800px', mx: 'auto' }}>
            Discover our comprehensive suite of features designed to transform your video processing workflow
          </Typography>
        </Container>
      </Box>

      {/* Main Features Grid */}
      <Container maxWidth="lg">
        <Box sx={{ py: 8 }}>
          <Grid container spacing={4}>
            {features.map((feature, index) => (
              <Grid item xs={12} md={4} key={index}>
                <Card sx={{ height: '100%' }}>
                  <CardContent sx={{ textAlign: 'center', py: 4 }}>
                    <Box sx={{ color: 'primary.main', mb: 2 }}>
                      {feature.icon}
                    </Box>
                    <Typography variant="h5" gutterBottom>
                      {feature.title}
                    </Typography>
                    <Typography color="text.secondary">
                      {feature.description}
                    </Typography>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Box>
      </Container>

      {/* Detailed Features Section */}
      <Box sx={{ bgcolor: 'grey.50', py: 8 }}>
        <Container maxWidth="lg">
          <Grid container spacing={8} alignItems="center">
            <Grid item xs={12} md={6}>
              <Typography variant="h3" gutterBottom>
                Advanced Processing Capabilities
              </Typography>
              <Typography variant="body1" paragraph>
                Our platform offers cutting-edge video processing features that help you achieve professional results quickly and efficiently.
              </Typography>
              <Box component="ul" sx={{ pl: 2 }}>
                <Typography component="li" sx={{ mb: 1 }}>
                  High-quality video processing
                </Typography>
                <Typography component="li" sx={{ mb: 1 }}>
                  Multiple format support
                </Typography>
                <Typography component="li" sx={{ mb: 1 }}>
                  Custom processing parameters
                </Typography>
                <Typography component="li">
                  Batch processing capabilities
                </Typography>
              </Box>
            </Grid>
            <Grid item xs={12} md={6}>
              <Card>
                <CardMedia
                  component="img"
                  height="300"
                  image="https://via.placeholder.com/600x400"
                  alt="Video Processing Dashboard"
                />
              </Card>
            </Grid>
          </Grid>
        </Container>
      </Box>
    </Box>
  );
};

export default Features;
